import React from 'react';
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';
import {setFlex, fixed, colors, elevation} from '../utilities';


function NavBarBase({ className }) {
    return (
        <div className={className}>
                <ul> <NavLink className="nav_link" exact to="/items">Catálogo de renta</NavLink></ul>
                <ul> <NavLink className="nav_link" exact to="/paquetes">Renta de paquetes</NavLink></ul>
                <ul> <NavLink className="nav_link" exact to="/venta">Catálogo de venta</NavLink></ul>
                <ul> <NavLink className="nav_link" exact to="/condiciones">Condiciones</NavLink></ul>
                <ul> <NavLink className="nav_link" exact to="/negocio">Inicia tu negocio</NavLink></ul>
                <ul> <NavLink className="nav_link" exact to="/nosotros">Nosotros</NavLink></ul>
                <ul> <NavLink className="nav_link" exact to="/contacto">Contacto</NavLink></ul>
        </div>
    )
}

const NavBar = styled(NavBarBase)`
    position: relative;
    width: 100%;    
    height: 3rem;      
    background-color: ${colors.blue_1};  
    margin-top: 3.1rem;
    // padding-bottom: 1rem;    
    ${fixed( )};
    ${setFlex( )};

    .nav_link{
        display: inline;
        font-size: 160%;
        color: ${colors.white_1};  
        list-style: none;
        text-decoration: none;
        margin-right: 3rem;
    }


`;

export default NavBar;
